import React from 'react';
import { Link, Router } from "react-router-dom";
import './Footer.css';
import facebook from '../img/facebook.png';

const Footer = () => {
	return (
		<div className='Footer'>
			<ul>
				<li>
		       		<a href="https://www.facebook.com/pressuresensitiveband/" className="outLink">

		       		</a>
		        </li>
		    </ul>
		    <ul>
				<li>
		       		<a href="https://pressuresensitive.bandcamp.com/">bandcamp</a>
		        </li>
		    </ul>
		    <ul>
				<li>
		       		<a href="https://www.instagram.com/pressuresensitiveband/">instagram</a>
		        </li>
		    </ul>
  		</div>
	);
}

export default Footer;
